package main
import (
  "bytes"
  "encoding/base64"
  "github.com/computeportal/glui"
)
const (
  hamster_data =""
)
var hamster = &glui.ImageData{nil, 0, 0}
func load_hamster() bool {
  b, err := base64.StdEncoding.DecodeString(hamster_data)
  if err != nil {panic(err)}
  buf := bytes.NewBuffer(b)
  data, err := glui.DecodeJPG(buf)
  if err != nil {panic(err)}
  hamster.Pix = data.Pix
  hamster.W = data.W
  hamster.H = data.H
  return true
}
var hamster_loaded = load_hamster()